import React from 'react';
import NavigationBar from '../NavigationBar/NavigationBar';
import "./TermeniiConditii.css"

function TermeniiConditii() {
    return (
      <div>
        <NavigationBar/>
        <h1>Termeni și Condiții</h1>
        <p className="termeni-conditii">  Direct Booking va pune la dispozitie un sistem automat care va ofera posibilitatea de a cauta si verifica disponibilitati pentru diferite servicii turistice si va permite sa efectuati rezervarea dorita.
Puteti alege dintr-o multitudine de servicii din Site avand posibilitatea de a efectua rezervari de servicii turistice direct de pe Site, cat si plata acestor servicii prin intermediul sistemului nostru de plati on-line.
Direct Booking actioneaza ca si Agent
Direct Booking actioneaza ca si agent pentru terti furnizori cum sunt: hoteluri, pensiuni, altii (Furnizori de Servicii Turistice).
Direct Booking nu-si asuma nicio responsabilitate pentru produsele si serviciile turistice oferite de Furnizorii de Servicii Turistice si nu garanteaza in nici un fel (fie explicit sau implicit) acuratetea sau calitatea produselor si a serviciilor reflectate pe acest Site.
</p>
      </div>
    );
  }
  
  export default TermeniiConditii;
